import React from 'react'

    const Contacts = ({ contacts }) => {
      return (
       <table>
         <tbody>
            {contacts.map((contact) => (
                <tr>
                    <td>{contact.name}</td>
                    <td>{contact.address}</td>
                    <td>{contact.city}</td>
                    <td>{contact.state}</td>
                    <td>{contact.zip_code}</td>
                    <td>{contact.city}</td>
                </tr>
              ))}
         </tbody>
       </table>

      )
    };

    export default Contacts
